import React from "react";
import Banner from "../Banner/Banner";
import Faq from "../Faq/Faq";
import Intro from "../Intro/Intro";
import Slicklist from "../Slicklist/Slicklist";
import MyTable from "../MyTable/MyTable";

const Home = () => {
  return (
    <div>
      <Banner />
      <Slicklist />
      <Intro />
      <MyTable />
      <Faq />
    </div>
  );
};

export default Home;
